void drawAxis(int x0, int y0, int x1, int y1, int colour) {
  /*
  Task: Implement Bresenhams algorithim
  */

  bool is_steep = abs(y1 - y0) > abs(x1 - x0);

  if (is_steep) {
    swap(&x0, &y0);
    swap(&x1, &y1);
  }
  if (x0 > x1) {
    swap(&x0, &x1);
    swap(&y0, &y1);
  }

  int deltax = x1 - x0, deltay = abs(y1 - y0);
  int error = -(deltax / 2);
  int y = y0, y_step = 0;

  if (y0 < y1) {
    y_step = 1;
  } else {
    y_step = -1;
  }

  for (int x = x0; x <= x1; x++) {
    if (is_steep) {
      plot_pixel(y, x, colour);
    } else {
      plot_pixel(x, y, colour);
    }
    error = error + deltay;
    if (error > 0) {
      y = y + y_step;
      error = error - deltax;
    }
  }
}

void swap(int *var1, int *var2) {
  int temp = *var1;
  *var1 = *var2;
  *var2 = temp;
}

